{"follow_up_q_similarity_rating":"5","follow_up_q_similarity_justify":"Refinera had difficulties doing well because of the hydrocarbon shortage in the New Mexico Area. Similarly, buying an oil well in Texas (being very near New Mexico) probably means the same problems would occur.

In addition to this, Enfuel had the exact same features as the Refinera project which caused it to fail. This included vertical intgeration, onshore oil well, a low probability of finding oil etc, that went against the post ad hoc analysis.","follow_up_q_relevance_specific_rating":"5","follow_up_q_relevance_specific_justify":"Very relevant. Because of the similarity of the Enfuel project's characteristics to the Refinera project's characteristics, it should be a good model to base our decision off.","follow_up_q_relevance_general_rating":"5","follow_up_q_relevance_general_justify":"The Refinera project obviously lists certain characteristics of an oil well that aren't recommended for purchase. However, of good use is the "post-hoc" analysis, which shows the desirable characteristics of an oil well. 

If an oil well project does come up with characteristics such as a 95% chance of finding oil, we should take that advice. "}

